import React, { useState } from 'react';
import Users from './Users/Users';


function App() {
  const [users, setUsers] = useState([
    {text:'John Doe',age:33, id:99},
    {text:'Foo Bar', id:98}
  ])
  let content = (
    <p style={{ textAlign: 'center' }}>No Users found.</p>
  );

  return (
    <div>
      <Users />
      {content}
    </div>
  );
}

export default App;
